import React from 'react'
import Navbar from './Navbar'

const Error = () => {
    return (
        <>

        <div className='container' style={{"margin" : "auto", "width" : "80%"}}>
            <h4 style={{"textAlign" : "center"}}>Sorry the data isn't available rightnow. Please Wait for some time. We'll resolve it soon</h4>
            <img style={{"width" : "20%", "height" : "40%"}} src='https://i.pinimg.com/originals/13/9a/19/139a190b930b8efdecfdd5445cae7754.png' alt='Aw. Not available' />
        </div>
        </>
    )
}

export default Error
